The given ratio tells us that $\frac{b}{a}=3$ or that $b=3a$. We substitute this value for $b$ so we have an equation with only one variable. We find  \begin{align*}
3a&=12-5a \\
\Rightarrow \quad 8a&=12 \\
\Rightarrow \quad a &= 12/8 \\
\Rightarrow \quad a &= \boxed{\frac{3}{2}}.
\end{align*}

Begin by noticing that $256=16^2$.  We can then repeatedly apply a difference of squares factorization: \begin{align*}
x^8-256&=(x^4+16)(x^4-16)\\
&=(x^4+16)(x^2+4)(x^2-4)\\
&=\boxed{(x^4+16)(x^2+4)(x+2)(x-2)}\\
\end{align*}

Using the quadratic formula $x = \frac{ - b \pm \sqrt {b^2 - 4ac} }{2a}$, we can find the roots of the quadratic. We find that $x = \frac{-5 \pm \sqrt{25-4c}}{2}$. Thus, setting our two expressions for $x$ equal to each other, we find that  \begin{align*}
\frac{-5 \pm \sqrt{25-4c}}{2} &= \frac{-5 \pm \sqrt{c}}{2} \quad \Rightarrow \\
25 - 4c &= c \quad \Rightarrow \\
c &= \boxed{5}.
\end{align*}

We can find $x$ by adding twice the first equation to five times the second. From \begin{align*}
2(3x-5y)+5(7x+2y)&=6x+35x\\&=41x,
\end{align*}and \begin{align*}
2(3x-5y)+5(7x+2y)&=2(-11)+5(-12)\\&=-22-60\\&=-82,
\end{align*}we find that $41x = -82$, or $x=-2.$

Substituting into the second equation, we can find $y:$ \begin{align*}
7x+2y&=-12 \\ \implies y&=\frac{1}{2}(-12-7(-2))\\&=\frac{1}{2}(-12+14)\\&=\frac{1}{2}(2)\\&=1.
\end{align*}Thus our answer is $\boxed{(-2,1)}.$

We can factor the expression $x+2$ out of each term:  \begin{align*}
x(x+2)+(x+2) &= x \cdot (x+2)+1 \cdot (x+2)\\
&= \boxed{(x+1)(x+2)}
\end{align*}

